const ImageRound = (props) => {
    return (
        <div>
            <div className="image">
                <image src={props.url} />
            </div>
            <style rjx>{`
                .image {
                    border-radius: 100%;
                    border: 1px solid;
                    height: 100px;
                    width: 100px;
                }
            `}</style>
        </div>
    )
}

export default ImageRound
